targets.expr:
ontaps3_labels{bucket=~"$Bucket",netapp_cluster=~"$Cluster",datacenter=~"$Datacenter",svm=~"$SVM"}
* on (volume, svm, netapp_cluster, datacenter) group_left (aggr)
  volume_labels{netapp_cluster=~"$Cluster",datacenter=~"$Datacenter",svm=~"$SVM"}

ontaps3_size
-
  ontaps3_logical_used_size{bucket=~"$Bucket",netapp_cluster=~"$Cluster",datacenter=~"$Datacenter",svm=~"$SVM"}

ontaps3_logical_used_size{bucket=~"$Bucket",netapp_cluster=~"$Cluster",datacenter=~"$Datacenter",svm=~"$SVM"}
and
  topk(
    $TopResources,
    avg_over_time(
      ontaps3_logical_used_size{bucket=~"$Bucket",netapp_cluster=~"$Cluster",datacenter=~"$Datacenter",svm=~"$SVM"}[3h] @ end()
